import React from 'react';
import ReactDOM from 'react-dom';

const el = (
	<div>
		<h1>Список дел</h1>
		<input placeholder="search"/>
		<ul>
			<li>Дело №1</li>
			<li>Дело №2</li>
		</ul>
	</div>
);
//console.log(el);
ReactDOM.render(el, document.getElementById('root'));
